-- Update organizations matching by name (case-insensitive)
-- Only fill NULL/empty fields - DO NOT overwrite existing data
UPDATE organizations o
SET
    address = CASE 
        WHEN NULLIF(TRIM(o.address), '') IS NULL AND NULLIF(TRIM(e.address), '') IS NOT NULL 
        THEN e.address 
        ELSE o.address 
    END,
    city = CASE 
        WHEN NULLIF(TRIM(o.city), '') IS NULL AND NULLIF(TRIM(e.city), '') IS NOT NULL 
        THEN e.city 
        ELSE o.city 
    END,
    state = CASE 
        WHEN NULLIF(TRIM(o.state), '') IS NULL AND NULLIF(TRIM(e.state), '') IS NOT NULL 
        THEN e.state 
        ELSE o.state 
    END,
    postal_code = CASE 
        WHEN NULLIF(TRIM(o.postal_code), '') IS NULL AND NULLIF(TRIM(e.postal_code), '') IS NOT NULL 
        THEN e.postal_code 
        ELSE o.postal_code 
    END,
    phone = CASE 
        WHEN NULLIF(TRIM(o.phone), '') IS NULL AND NULLIF(TRIM(e.phone), '') IS NOT NULL 
        THEN e.phone 
        ELSE o.phone 
    END,
    website = CASE 
        WHEN NULLIF(TRIM(o.website), '') IS NULL AND NULLIF(TRIM(e.website), '') IS NOT NULL 
        THEN e.website 
        ELSE o.website 
    END,
    updated_at = NOW()
FROM enrichment_import e
WHERE LOWER(TRIM(o.name)) = LOWER(TRIM(e.organization_name))
AND o.deleted_at IS NULL;

-- Report match statistics
DO $$
DECLARE
    v_matched INT;
    v_updated_address INT;
    v_updated_phone INT;
    v_updated_website INT;
BEGIN
    -- Count matched organizations
    SELECT COUNT(DISTINCT o.id)
    INTO v_matched
    FROM organizations o
    JOIN enrichment_import e ON LOWER(TRIM(o.name)) = LOWER(TRIM(e.organization_name))
    WHERE o.deleted_at IS NULL;
    
    -- Count populated fields
    SELECT 
        COUNT(*) FILTER (WHERE address IS NOT NULL AND address != ''),
        COUNT(*) FILTER (WHERE phone IS NOT NULL AND phone != ''),
        COUNT(*) FILTER (WHERE website IS NOT NULL AND website != '')
    INTO v_updated_address, v_updated_phone, v_updated_website
    FROM organizations 
    WHERE deleted_at IS NULL;
    
    RAISE NOTICE '=== ENRICHMENT BACKFILL RESULTS ===';
    RAISE NOTICE 'Organizations matched: %', v_matched;
    RAISE NOTICE 'Now have address: %', v_updated_address;
    RAISE NOTICE 'Now have phone: %', v_updated_phone;
    RAISE NOTICE 'Now have website: %', v_updated_website;
END $$;

DROP TABLE enrichment_import;

COMMIT;
